import React, { Component } from "react";
import ListQnA from "./ListQnA";

class QnA extends Component {
  render(props) {
    console.log("render");
    const greeting = "Welcome to React";

    return (
      <div>
        <div className="container">
          <h1>Java Interview Questions</h1>
          <ListQnA greeting={greeting} />
        </div>
      </div>
    );
  }
}

export default QnA;
